import base64
import uuid


def base64_to_img(base64_str):
    with open('./img/{}.jpg'.format(uuid.uuid4()), 'wb') as file:
        jiema = base64.b64decode(base64_str)  # 解码
        file.write(jiema)  # 将解码得到的数据写入到图片中


if __name__ == '__main__':
    data = ""
    base64_to_img(data)
